import React from "react";

/**
 * Reuseable button component
 */
const ButtonSecondary = ({ children, ...rest }) => {
  return (
    <button
      className="shadow-md flex items-center gap-2 font-semibold bg-purple-light w-full rounded-full justify-center px-4 py-2 text-purple-dark hover:bg-purple-normal hover:text-white transition-all"
      {...rest}
    >
      {children}
    </button>
  );
};

export default ButtonSecondary;
